import Link from 'next/link';
import { useState, useEffect } from 'react';

const Home = () => {
    const [title, setTitle] = useState('Home');

    useEffect(() => setTimeout(() => setTitle('Changed Home'), 3000), []);
    
    return (
        <>
            <div>
                {title}
            </div>
            <Link href="/">App</Link>
        </>
    );
};

export default Home;
